Denna avancerade funktion håller alla öppna bits av modellen intakt. Normalt försöker Cura fylla igen alla små hål och ta bort allt med stora hål. Men denna funktion behåller bits som inte är perfekta och kör modellen rakt av. Detta val är normalt inte vad man önskar men den kan vara användbar när andra slice metoder inte fungerar. Som med alla avancerade funktioner kan resultatet variera stort och du använder den på egen risk
Extensive stitching(?) försöker fixa till öppna hål i modellen med mötande polygoner som täcker hålen. Denna algoritm kräver myckket datorkraft och kan förlänga slice tiden. Som med alla avancerade funktioner kan resultatet variera stort och du använder den på egen risk.
